import styles from "./profiledroplist.module.css";
import DropList from "../common-components/DropList";

function ProfileDropList() {
  const style={overflow:"hidden" , textOverflow:"ellipsis", whiteSpace:"nowrap"};
  return (
    <DropList className={styles.profile_droplist}>
      <li className={styles.profile_profile}>
        <button className={styles.profile_button}>
          <i className={styles.profile_image}></i>
        </button>
        <div className={styles.profile_name}>
          <span style={style}>Ron Jacob Varghese-AM.EN.U4CSE19346</span>
          <span style={style,{color:""}}>ronjacobvarghese@am.students.amrita.edu</span>
        </div>
      </li>
    </DropList>
  );
}

export default ProfileDropList;
